function Movie() {
    const options = {
        method: 'GET',
        headers: {
          accept: 'application/json',
          Authorization: 'Bearer eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOiI2MGJkOTE3NGY0ZmQxY2VkY2UxYmUzNDI5NjVhZjIwOCIsInN1YiI6IjY1NjU2MDE0MTU2Y2M3MDEwY2IzMTUxMSIsInNjb3BlcyI6WyJhcGlfcmVhZCJdLCJ2ZXJzaW9uIjoxfQ.NdAZWJi4rCPV--smFM6EyDq30xjAId--D-Dm1rH4qZQ'
        }
      };

      fetch('https://api.themoviedb.org/3/authentication', options)
        .then(response => response.json())
        .then(response => console.log(response))
        .catch(err => console.error(err));

    useEffect(() => {
        getMovie();
    }, [])
    return (
        <div>Movie</div>
    )
}

export default Movie
